<body lang="pt-BR" dir="ltr">
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><b>GERENCIAMENTO
DE ENCONTROS DA CÉLULA</b></font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt">Nosso
sistema tem múltiplas utilidades e uma delas é o gerenciamento
detalhado dos encontros da célula. Essas informações vão gerar
estatísticas e relatórios para os administradores de rede. Vamos
ver passo a passo como se faz! </font>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt">Antes
de tudo, é importante saber que apenas quem tem a permissão do
sistema conseguirá acessar o gerenciamento de encontros. A
princípio, são os usuários administradores e os líderes de célula
que podem desempenhar essa função. Você pode verificar as
permissões em “Segurança”, na opção “Grupo/Permissões”.</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><b>Passo
1: </b></font><font size="4" style="font-size: 14pt">No menu lateral,
clique em “Células” e depois em “Gerenciar Encontros”.
Tanto para o usuário Líder quanto para o usuário administrador, a
tela será a mesma. A diferença será que para o administrador,
todas as células cadastradas irão aparecer na listagem e, para o
líder, apenas sua própria célula.</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><img src="data:image/png;base64," name="Imagem 26" align="bottom" width="1286" height="625" border="0"></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><b>Passo
2:</b></font><font size="4" style="font-size: 14pt"> Selecione a
célula, o mês e o dia do encontro que você deseja gerenciar.</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><img src="data:image/png;base64," name="Imagem 6" align="bottom" width="1285" height="627" border="0"></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><b>Passo
3: </b></font><font size="4" style="font-size: 14pt">A partir daqui,
existem duas possibilidades de gerenciamento.</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<ul>
    <li><p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><u>Quando
    o encontro da célula ainda não aconteceu</u></font><font size="4" style="font-size: 14pt">:
    mantenha a opção </font><font color="#ff0000"><font size="4" style="font-size: 14pt"><b>NÃO</b></font></font><font size="4" style="font-size: 14pt">
    em “Encontro Encerrado” e use a parte lateral direita da tela
    para anexar arquivos, fazer observações e até compartilhar links.</font></p>
</ul>
<p style="margin-bottom: 0.28cm; line-height: 108%"><img src="data:image/png;base64," name="Imagem 31" align="bottom" width="1286" height="625" border="0"></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt">As
informações aparecerão dessa forma para os participantes da célula
que acessarem seus logins ao longo da semana anterior ao próximo
encontro. (Caso você ainda não saiba o que são os logins de
membro, acesse nosso tutorial “Criando Login do Membro” em
“Ajuda/Documentação” no menu lateral)</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><img src="data:image/png;base64," name="Imagem 34" align="bottom" width="1285" height="626" border="0"></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<ul>
    <li><p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><u>Quando
    o encontro já aconteceu</u></font><font size="4" style="font-size: 14pt">:
    selecione </font><font color="#00b050"><font size="4" style="font-size: 14pt"><b>SIM</b></font></font><font size="4" style="font-size: 14pt">
    na opção “Encontro Encerrado” e gerencie informações como a
    presença dos integrantes, observações, participação de
    visitantes, etc.</font></p>
</ul>
<p style="margin-bottom: 0.28cm; line-height: 108%"><img src="data:image/png;base64," name="Imagem 19" align="bottom" width="1285" height="1252" border="0"></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt"><b>Passo
4:</b></font><font size="4" style="font-size: 14pt"> No final dessa
página de gerenciamento, existe um seção reservada para um
questionário. As perguntas devem ser definidas em “Questionário
Padrão Encontros”, em “Cadastro Base” no menu lateral. Abaixo
está exemplificado um questionário.</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><img src="data:image/png;base64," name="Imagem 22" align="bottom" width="1286" height="625" border="0"></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt">Os
campos numéricos no questionário (você terá que fazer essa
escolha ao criar a pergunta no Cadastro Base) gerarão estatísticas
na “Visão Geral” de Células. Além disso, as informações
cadastradas nos encontros poderão ser transformadas em relatório
através do botão “Imprimir” na própria página de
“Gerenciamento de Encontros” ou a partir de “Relatório
Encontros” em “Células” no menu lateral.</font></p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><br><br>
</p>
<p style="margin-bottom: 0.28cm; line-height: 108%"><font size="4" style="font-size: 14pt">E
isso é tudo que você precisa saber sobre o Gerenciamento de
Encontros!</font></p>
